          img: '',
          desc: 'bim bim bam bam boom',
          category: 'chairs',
          price: '54.99'
        }
      ]
    }
  }
  render(){
    return (
      <div className="wrapper">
        <Header />
        <Items />
        <Footer />
      </div>

    )
  }
}

export default App;
